      parser(stdOut, stdErr) {
         return parseBranchDeletions(stdOut, stdErr);
      },
      onError({ exitCode, stdOut }, error, done, fail) {
         if (!hasBranchDeletionError(String(error), exitCode)) {
            return fail(error);
